INSERT INTO `front_cms_pages` (`id`, `page_type`, `is_homepage`, `title`, `url`, `type`, `slug`, `meta_title`, `meta_description`, `meta_keyword`, `feature_image`, `description`, `publish_date`, `publish`, `sidebar`, `is_active`, `created_at`) VALUES
(1, 'default', 1, 'Home', 'page/home', 'page', 'home', '', '', '', 'https://company.smartrentals.live/uploads/gallery/media/Unknown-71-e1369379778504.jpeg', '<h4>We offer a three year programme, carefully designed so your child develops at a suitable pace. With generous helpings of praise and confidence building methods, we combine work and play to teach reading, writing and arithmetic to prepare your child for entrance into Primary School.</h4>\r\n\r\n<h4>We use thematic methods to develop vocabulary and language across a variety of useful subjects. Each day we organise lots of singing and storytelling to encourage listening and comprehension skills. All this is supported by computer games which introduce your child to new technology while reinforcing reading, writing and numeracy skills.</h4>\r\n\r\n<h4>Our staff (most of whom have been with us over many years) are fully committed to the welfare of the children in their care. We have a combination of well-trained teachers and carers and our own catering staff.</h4>', '0000-00-00', 1, 1, 'no', '2021-10-22 07:46:33'),
(2, 'default', 0, 'Feedback', 'page/feedback', 'page', 'feedback', 'Complain form', '                                                                                                                                                                                    complain form                                                                                                                                                                                                                                ', 'complain form', 'https://zawadischools.com/uploads/gallery/media/kimberly-farmer-lUaaKCUANVI-unsplash.jpg', '<p>[form-builder:complain]</p>', '0000-00-00', 1, 1, 'no', '2021-06-09 13:49:09'),
(54, 'default', 0, '404 page', 'page/404-page', 'page', '404-page', '', '                                ', '', 'https://zawadischools.com/uploads/gallery/media/anton-sukhinov-_C2A8THeKKs-unsplash.jpg', '<p>404 page found</p>', '0000-00-00', 0, 1, 'no', '2021-06-09 13:48:21'),
(76, 'default', 0, 'Contact us', 'page/contact-us', 'page', 'contact-us', '', '', '', 'https://company.smartrentals.live/uploads/gallery/media/Unknown-88.jpeg', '<div class=\"container\">\r\n<div class=\"row\">\r\n<h2>Send In Your Query</h2>\r\n\r\n<p style=\"margin-left:200px\">[form-builder:contact_us]<!--./row--></p>\r\n\r\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">\r\n<h3>&nbsp;</h3>\r\n</div>\r\n\r\n<div>\r\n<p style=\"margin-left:200px\"><iframe height=\"450\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.737253130542!2d36.733121314753966!3d-1.3338199990271797!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x182f1b265977db5f%3A0xd2855f7794ae15be!2sMsingi%20Bora%20Kindergarten!5e0!3m2!1sen!2ske!4v1634890884963!5m2!1sen!2ske\" style=\"border:0;\" width=\"90%\"></iframe></p>\r\n</div>\r\n</div>\r\n</div>', '0000-00-00', 0, NULL, 'no', '2021-10-22 08:38:26'),
(77, 'manual', 0, 'Home', 'page/home-1', 'page', 'home-1', '', '', '', 'https://company.smartrentals.live/uploads/gallery/media/Unknown-71-e1369379778504.jpeg', '<h4><img alt=\"School\" src=\"https://company.smartrentals.live/uploads/gallery/media/Unknown-71-e1369379778504.jpeg\" style=\"height:100%; width:100%\" /></h4>\r\n\r\n<h4><span style=\"font-family:times new roman,times,serif\">We offer a three year programme, carefully designed so your child develops at a suitable pace. With generous helpings of praise and confidence building methods, we combine work and play to teach reading, writing and arithmetic to prepare your child for entrance into Primary School.</span></h4>\r\n\r\n<h4><span style=\"font-family:times new roman,times,serif\">We use thematic methods to develop vocabulary and language across a variety of useful subjects. Each day we organise lots of singing and storytelling to encourage listening and comprehension skills. All this is supported by computer games which introduce your child to new technology while reinforcing reading, writing and numeracy skills.</span></h4>\r\n\r\n<h4><span style=\"font-family:times new roman,times,serif\">Our staff (most of whom have been with us over many years) are fully committed to the welfare of the children in their care. We have a combination of well-trained teachers and carers and our own catering staff.</span></h4>', '0000-00-00', 0, NULL, 'no', '2021-10-27 12:13:35');
