INSERT INTO `front_cms_programs` (`id`, `type`, `slug`, `url`, `title`, `date`, `event_start`, `event_end`, `event_venue`, `description`, `is_active`, `created_at`, `meta_title`, `meta_description`, `meta_keyword`, `feature_image`, `publish_date`, `publish`, `sidebar`) VALUES
(1, 'notice', 'monday-26th-july-closing-thursday-30th-september-2021half-term-closed-from-thursday-26th-friday-27th-july-2021', 'read/monday-26th-july-closing-thursday-30th-september-2021half-term-closed-from-thursday-26th-friday-27th-july-2021', 'Monday 26th July – Closing: Thursday 30th September 2021Half Term: Closed from Thursday 26th – Friday 27th July 2021', '2021-11-12', NULL, NULL, NULL, '<p style=\"margin: 0px 0px 18px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; line-height: 20px; color: rgb(63, 63, 63); font-family: Georgia, Helvetica, sans-serif;\">Monday 26th July &ndash; Closing: Thursday 30th September 2021Half Term: Closed from Thursday 26th &ndash; Friday 27th July 2021</p>', 'no', '2021-10-22 08:50:41', '', '', '', 'https://zawadischools.com/uploads/gallery/media/kimberly-farmer-lUaaKCUANVI-unsplash.jpg', '0000-00-00', '0', 1),
(2, 'gallery', 'learn-1', 'read/learn-1', 'Learn', NULL, NULL, NULL, NULL, '<h4 style=\"margin: 0px 0px 12px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; background: transparent; line-height: 25px; font-family: Georgia, \"Times New Roman\", Times, serif; color: rgb(63, 63, 63);\">We offer a three year programme, carefully designed so your child develops at a suitable pace. With generous helpings of praise and confidence building methods, we combine work and play to teach reading, writing and arithmetic to prepare your child for entrance into Primary School.</h4>\r\n\r\n<h4 style=\"margin: 0px 0px 12px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; background: transparent; line-height: 25px; font-family: Georgia, \"Times New Roman\", Times, serif; color: rgb(63, 63, 63);\">We use thematic methods to develop vocabulary and language across a variety of useful subjects. Each day we organise lots of singing and storytelling to encourage listening and comprehension skills. All this is supported by computer games which introduce your child to new technology while reinforcing reading, writing and numeracy skills.</h4>\r\n\r\n<h4 style=\"margin: 0px 0px 12px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; background: transparent; line-height: 25px; font-family: Georgia, \"Times New Roman\", Times, serif; color: rgb(63, 63, 63);\">Our staff (most of whom have been with us over many years) are fully committed to the welfare of the children in their care. We have a combination of well-trained teachers and carers and our own catering staff.</h4>', 'no', '2021-10-22 08:06:04', 'Conducive learning ', 'Conducive learning environment', 'Conducive learning', 'https://company.smartrentals.live/uploads/gallery/media/Unknown-71-e1369379778504.jpeg', '0000-00-00', '0', 1),
(3, 'gallery', 'grow', 'read/grow', 'Grow', NULL, NULL, NULL, NULL, '<p>We all understand the importance of healthy eating, especially for children growing up fast through the early years. That&rsquo;s why we provide a nutritious, well-balanced lunch, freshly cooked on the premises for full day children. We also serve a range of healthy snacks and drinks during mid-morning and afternoon breaks.</p>', 'no', '2021-10-22 08:08:45', '', '', '', 'https://company.smartrentals.live/uploads/gallery/media/Unknown-88.jpeg', '0000-00-00', '0', 1),
(4, 'banner', NULL, NULL, 'Banner Images', NULL, NULL, NULL, NULL, NULL, 'no', '2021-06-09 13:50:27', '', '', '', '', '0000-00-00', '0', 0),
(6, 'gallery', 'play', 'read/play', 'Play', NULL, NULL, NULL, NULL, '<h4 xss=\"removed\">Through creative play and group activities, we help your child to begin developing the social skills needed to succeed in later years. Learning to interact with others, to share and accept structure in combined work and play will help inspire confidence and independence in the future. Children are encouraged to take part in&nbsp;<a href=\"http://www.msingiborakindergarten.com/wordpress/more-to-learn/\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; cursor: pointer; display: inline; color: rgb(22, 162, 221);\" title=\"More to Learn\">extracurricular activities</a>&nbsp;related to sports, music, art and languages.</h4>', 'no', '2021-10-22 08:09:09', '', '', '', 'https://company.smartrentals.live/uploads/gallery/media/Unknown-43.jpeg', '0000-00-00', '0', NULL),
(7, 'notice', 'the-school-office-will-be-open-from-monday-28th-to-thursday-31st-december-from-830-am-230-pm-regular-office-hours-will-resume-from-monday-4th-january-2021', 'read/the-school-office-will-be-open-from-monday-28th-to-thursday-31st-december-from-830-am-230-pm-regular-office-hours-will-resume-from-monday-4th-january-2021', 'The school office will be open from Monday 28th  to Thursday 31st  December from 8.30 am-2.30 pm. Regular office hours will resume from Monday 4th January 2021.', '2021-10-22', NULL, NULL, NULL, '<p><span style=\"color: rgb(63, 63, 63); font-family: Georgia, Helvetica, sans-serif;\">The school office will be open from Monday 28th&nbsp; to Thursday 31st&nbsp; December from 8.30 am-2.30 pm. Regular office hours will resume from Monday 4th January 2021.</span></p>', 'no', '2021-10-22 09:19:01', '', '', '', '', '0000-00-00', '0', NULL);
